import React, { Component } from 'react'

export default class SignUp extends Component {
    render() {
        return (
            <div>
                <form>
                    <input
                        onChange={this.onChangeHandler.bind(this)} 
                        name="fname" type="text" placeholder="First Name"
                    />
                    <input
                        onChange={this.onChangeHandler.bind(this)} 
                        name="fname" type="text" placeholder="First Name"
                    />
                    <input
                        onChange={this.onChangeHandler.bind(this)} 
                        name="fname" type="text" placeholder="First Name"
                    />
                    <input
                        onChange={this.onChangeHandler.bind(this)} 
                        name="fname" type="text" placeholder="First Name"
                    />
                    <input 
                        name="submit" type="submit" value="Sign Up!"
                    />
                </form>
            </div>
        )
    }
}
